import React from 'react'
import './Menu.component.scss'
import { Link, useHistory } from 'react-router-dom'
import { motion } from "framer-motion"

const wrapperVariants = {
    initial: {},
    visible:{
        transition: {
            delayChildren: 0.6,
            staggerChildren: 0.5,
            staggerDirection: -1
        }
    }
}

const linkVariants = {
    initial: { opacity: 0, y: '100px'},
    visible: { opacity: 1, y: 0, transition: {duration: 3}}
}

export default function Menu() {
    return (
        <motion.div className="menu" initial={'initial'} animate={'visible'} variants={wrapperVariants}>
            <motion.div initial={'initial'} animate={'visible'} variants={linkVariants}>
                <Link to="/" exact>
                    <h3>Home</h3>
                </Link>
            </motion.div>
            <Link to="/produse" exact>
                <motion.h3 initial={'initial'} animate={'visible'} variants={linkVariants}>Produse</motion.h3>
            </Link>
            <Link to="/info" exact>
                <motion.h3 initial={'initial'} animate={'visible'} variants={linkVariants}>Livrare</motion.h3>
            </Link>
            <Link to="/info" exact>
                <motion.h3 initial={'initial'} animate={'visible'} variants={linkVariants}>Retur</motion.h3>
            </Link>
            <Link to="/info" exact>
                <motion.h3 initial={'initial'} animate={'visible'} variants={linkVariants}>Plata</motion.h3>
            </Link>
        </motion.div>
    )
}
